import{_ as e,c as t,o as r,a1 as a}from"./chunks/framework.DuhvrP8X.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"faq-comparsion.md","filePath":"faq-comparsion.md"}'),n={name:"faq-comparsion.md"},s=a('<h3 id="what-is-the-difference-between-computer-science-and-digital-science" tabindex="-1">What is the difference between <strong>Computer Science</strong> and <strong>Digital Science</strong>? <a class="header-anchor" href="#what-is-the-difference-between-computer-science-and-digital-science" aria-label="Permalink to &quot;What is the difference between **Computer Science** and **Digital Science**?&quot;">​</a></h3><p>There are two kinds of differences between <a href="https://www.uibk.ac.at/studium/angebot/es-informatik/index.html.en" target="_blank" rel="noreferrer">Supplementary Program <strong>Computer Science</strong></a> (SP-CS) and <a href="https://www.uibk.ac.at/en/disc/teaching/minor-digital-science/" target="_blank" rel="noreferrer">Minor <strong>Digital Science</strong></a> (M-DS): related to the formal regulations and related to the content (<a href="https://www.uibk.ac.at/informatik/studium/vergleich-ewsi-und-edisc.html" target="_blank" rel="noreferrer">in German</a>).</p><p><strong>supplementary program</strong> <strong>(SP)</strong></p><p><strong>properties</strong></p><p><strong>minor</strong></p><p><a href="https://www.uibk.ac.at/informatik/studium/erweiterungsstudium.html.en" target="_blank" rel="noreferrer"><strong>Computer Science</strong></a> <strong>(CS)</strong></p><p><a href="https://www.uibk.ac.at/en/disc/teaching/minor-digital-science/" target="_blank" rel="noreferrer"><strong>Digital Science</strong></a></p><p><strong>FORMAL</strong></p><p>60 ECTS credits / 9 modules</p><p><strong>credits  / courses</strong></p><p>30 ECTS credits / 6 courses</p><p>required</p><p><strong>enrollment</strong></p><p>not required, registration to individual courses</p><p>students of admitted study programs</p><p><strong>target group</strong></p><p>students of all study programs</p><p>after a regular study program (bachelor&#39;s or master&#39;s program) or in parallel after having collected at least 30 ECTS credits in a regular study program</p><p><strong>integration<br> options</strong></p><p>as part of a regular study program (bachelor&#39;s or master&#39;s program), which must be active for the whole duration of the minor</p><p>German</p><p><strong>language<br> of instruction</strong></p><p>English</p><p><strong>CONTENT</strong></p><p>computer science foundations</p><p><strong>main focus</strong></p><p>programmatic data analysis</p><p>32.5 ECTS credits in programming and software development including software architecture and software engineering</p><p>3 programming paradigms</p><ul><li>procedural/imperative, e.g. C</li><li>object-oriented, e.g. Java</li><li>functional, e.g. Haskell</li></ul><p><strong>programming</strong></p><p>5 ECTS credits in an introduction to programming</p><p>one programming language commonly used in</p><p>data science, e.g. Python or R</p><p>15 ECTS credits in data-related modules: algorithms and data structures, database systems</p><p><strong>data</strong></p><p>20 ECTS credits in data-focused modules: data management, data analysis courses and project</p><p>7.5 ECTS credits elective courses from the bachelor’s program computer science</p><p><strong>elective<br> courses</strong></p><p>10 ECTS credits from a selection of courses in data analysis and aspects of digitalisation modules to tailor minor to the field of interest, e.g. legal, ethical or business aspects</p><p>Computer Scientists / Department of Computer Science</p><p><strong>teaching staff</strong></p><p>Interdisciplinary / Digital Science Center</p><p>The SP is a subset of basic courses of the bachelor’s program in computer science. It is possible to transfer eligible credits from and to this program.</p><p><strong>crediting</strong></p><p>depending on the curricula: as minor or as elective modules, especially as interdisciplinary and generic skills</p>',46),o=[s];function i(p,c,g,l,d,m){return r(),t("div",null,o)}const h=e(n,[["render",i]]);export{f as __pageData,h as default};
